		        if (this.props.posts[i].id === parseInt(this.props.match.params.postId)) {
		        	post = this.props.posts[i];
		        } 

	        }
        } else {
	        post = {'title' : 'default'}

	    }
        return (

          <div className='blog-post-wrapper'>
            <h1>{post.title}</h1>
